FeedPackage.ReleaseNotes:
Error class few variables became static for optimization of memory.

#1.0.21
Fixed automatic casting.
class Ax{
 public int A {get;set;} 
 public int B {get;set;}
 public int C {get;set;}
}
class Bx{
 public int A {get;set;} 
 public int B {get;set;}
}
var a = new Ax(){
A= 1,
B= 2,
C= 3
};
var b = Ax.Cast<Ax,Bx>(); // get new Bx class from that Ax
